import React from 'react';
import { Route, Redirect } from 'react-router-dom';

export default function PrivateRoute ({getAccountTypeUser, accountTypeComponent, children, ...rest}) {
    return (
      <Route
        {...rest}
        render={(props) => getAccountTypeUser() === accountTypeComponent
          ? children
          : <Redirect to={{pathname: '/login', state: {from: props.location}}} />}
      />
    )
  }
